import React, { Component } from 'react'
import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";
import NavigationBar from './components/NavigationBar';
import Blog from './pages/Blog';
import Home from './pages/Home';

/*
npm install react-router-dom
*/
export default class App extends Component {
  render() {

    const nikeAir = [
      {
          "name": "Air Max 1",

      },
      {
          "name": "Air Max Light",

      },
      {
          "name": "Air Max 90",

      },
      {
          "name": "Air Max 180",

      },
      {
          "name": "Air Max 93",

      },
      {
          "name": "Air Max 95",

      },
      {
          "name": "Air Max 97",

      },
      {
          "name": "Air Max Plus Tuned",

      },
      {
          "name": "Air Max 360",

      },
      {
          "name": "Air VaporMax",

      },
      {
          "name": "Air Max 270",
      },
      {
          "name": "Air Max 720",
          "year": 2019,
          "image" : "img/img/img/img12.jpg",
          "body":"One year after the Air Max 270, Nike debuted their second Air unit to be designed for lifestyle purposes with the Air Max 720. As opposed to the heel-only 270 Air unit, the 720 Air unit extends under the forefoot, and is also taller than the 270 by 6mm. New colorways of the Air Max 720 and additional designs based on its Air unit, including the basketball-inspired Air Max 720 SATRN and a hybrid based on the retro Air More up-tempo, continue to be released.",
          "link":"",
          "id":11
      }
      ]


    return (
      <Router>
        <div>
          <NavigationBar />
        </div>
        <Route exact path='/' component={Home} />
        <Route path='/blog' render={() => <Blog data={nikeAir} />} />

      </Router>
    )
  }
}
